  \"Meteorological and oceanographic data collected from the National Data Buoy Center
  Coastal-Marine Automated Network (C-MAN) and moored (weather) buoys during July
  2015 (NCEI Accession 0130916)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 9,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-02-26T22:16:20.779536\",\n\t\"name\": \"meteorological-and-oceanographic-data-collected-from-the-national-data-buoy-center-coastal\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Data Buoy Center (NDBC) established
  the Coastal-Marine Automated Network (C-MAN) for the National Weather Service in
  the early 1980's. NDBC has installed approximately 50 C-MAN stations on lighthouses,
  at capes and beaches, on near shore islands, and on offshore platforms. NDBC has
  deployed over 100 moored (a.k.a., weather) buoys in coastal and offshore waters
  from the western Atlantic to the Pacific Ocean around Hawaii, and from the Bering
  Sea to the South Pacific. C-MAN and moored buoy data typically include barometric
  pressure, wind direction, speed and gust, and air temperature; however, some C-MAN
  stations are equipped to also measure seawater temperature, water level, waves,
  and relative humidity. Moored buoys measure wave energy spectra from which NDBC
  derives significant wave height, dominant wave period, and average wave period.
  In addition, many moored buoys measure the direction of wave propagation.In collaboration,
  NDBC and the National Oceanographic Data Center (NODC) are archiving these data
  from C-MAN and moored buoys. This NODC Accession is part of the collaboration and
  it contains netCDF (version 4) files with the data collected during July 2015.\",\n\t\"license_title\":
